import {BrowserRouter as Router , Routes , Route } from "react-router-dom";
import NavBar from "./components/NavBar";
import Product from "./components/Product";
function App() {
  return (

    <div className="App" >
    <Router>
      <Routes>

       <NavBar/>
       <Product/>
      </Routes>
     </Router>
    </div>
  );
}

export default App;
